import React, { useEffect, useState, useRef } from "react";
import { ToastContainer, toast } from "react-toastify";
import{Link} from "react-router-dom";
import "react-toastify/dist/ReactToastify.css";

import imagenLogin from 'media/login.svg';
import Bienvenido from './listaVentas';


function TSolutions() {
    return (
        <div class="h-full w-full">
                <span className="p-2 font-sick font-semibold text-6xl flex justify-center">T-SOLUTIONS</span>
                <nav className="flex text-white">
                    <ul className='flex h-full justify-between my-1'>
                    <li> <img className='m-3 p-5 w-full ' src={imagenLogin} alt="Logo" />
                        </li>
                    <li className='m-5 text-1xl font-semibold text-gray-700 text-left' >
                                                        
                         <spam>Somos una empresa colombiana dedicada a la venta de productos tecnológicos de Alta Gama al por mayor y al mejor precio, somos importadores directos trayéndote lo último en productos tecnológicos.
                        
                        Con un equipo interdisciplinario joven pero altamente capacitado y  experiencia, que está a la vanguardia de lo que está pasando en la tecnología para acompañar a nuestros clientes en la constante evolución tecnológica.</spam>

                        </li>
                    </ul>
                </nav>

           

        </div>
    );
}

export default TSolutions
